import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const h=JSON.parse('{"title":"§ 63.2-1236 Duty of Department to disseminate information.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-1236.md","filePath":"vacode/63.2-1236.md"}'),i={name:"vacode/63.2-1236.md"},n=r('<h1 id="§-63-2-1236-duty-of-department-to-disseminate-information" tabindex="-1">§ 63.2-1236 Duty of Department to disseminate information. <a class="header-anchor" href="#§-63-2-1236-duty-of-department-to-disseminate-information" aria-label="Permalink to &quot;§ 63.2-1236 Duty of Department to disseminate information.&quot;">​</a></h1><p>The Department shall develop and disseminate information to the public regarding the provisions of parental placement adoptions, including the desirability of initiating the procedures required by § <a href="http://law.lis.virginia.gov/vacode/63.2-1232/" target="_blank" rel="noreferrer">63.2-1232</a> as early in the placement and adoption process as possible to ensure that birth parents are aware of the provisions of this law and begin required procedures in a timely manner.</p><p>1989, c. 647, § 63.1-220.3; 1991, cc. 364, 602; 1992, c. 125; 1993, cc. 338, 553; 1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0772" target="_blank" rel="noreferrer">772</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0826" target="_blank" rel="noreferrer">826</a>; 1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP1028" target="_blank" rel="noreferrer">1028</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0830" target="_blank" rel="noreferrer">830</a>, § 63.1-219.43; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',3),o=[n];function s(l,c,p,d,f,_){return t(),a("div",null,o)}const m=e(i,[["render",s]]);export{h as __pageData,m as default};
